    false,nt"url": null,nt"notes": "Starting with Fiscal Year 2001, the Annual
    Report and Annual Report Appendix have been combined and renamed the Combined Statement
    of Receipts, Outlays, and Balances of the United States Government (Combined Statement).
    The Combined Statement is recognized as the official publication of receipts and
    outlays with which all other reports containing similar data must be in agreement.
    It presents budgetary results at the summary and detail level. It is part of a triad
    of publications that includes: the Monthly Treasury Statement, a report of the government
    receipts and outlays that is based on agency reporting, and the Daily Treasury Statement,
    summarizing data on the cash and debt operations of the Treasury based on reporting
    of the Treasury account balances of the Federal Reserve banks.",nt"license_title":
